import React from "react"


const App = () => {
  const courses = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }
  const parts = courses.parts
  console.log(parts.type)
  return (
    <>
    <h1>{courses.name}</h1>
    <ul>
      {parts.map(part => <li key ={part.id}>{parts.name} {parts.exercises}</li>)}
    </ul>
    </>
  )
}

export default App;
